import './styles/styles.css';
import SplitLayout from './components/SplitLayout';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ConsumerLayout from './pages/ConsumerLayout';
import DriverLayout from './pages/DriverLayout';


function App() {
  return (
    <Router>
      <Switch>
      <Route path="/consumerHome" component={ConsumerLayout} />
        <Route path="/driverHome" component={DriverLayout} />
        <Route path="/" component={SplitLayout} />
      </Switch>
    </Router>
  );
}

export default App;
